import React from 'react'
import "./style.scss";
import gsap from 'gsap';
import {FaGithub} from "react-icons/fa";
 

export default function Socials() {
    
    return (
        <section className="socials" data-scroll-section>
            
            <div id="heading"> Socials</div>             
            <div id="icons">
                <FaGithub/>
            
            </div>
        </section>
    )
}
